      {openGroups.map(group => (
        <div 
          key={group.id} 
          className={`tab ${group.id === activeGroupId ? 'active' : ''}`}
          onClick={() => onTabChange(group.id)}
        >
          <span>{group.id}</span>
          <button onClick={(e) => { e.stopPropagation(); onCloseTab(group.id); }}>Ã—</button>
        </div>
      ))}
